    setShowParagraph((prevShowParagraph) => !prevShowParagraph)
  }
  return (
    <div className="app">
      <h1>Hi there!</h1>
      <Button onClick={toggleParagrapHandler}>Toggle Paragraph</Button>
    </div>
  );
}

export default App;
